      "Modifier": "Changed",
      "message": "RUSSIA AND BELARUS RESTRICTIONS :\n1- ALL AIRCRAFT REGISTERED IN RUSSIA OR OPERATED BY RUSSIAN AIR \nCARRIERS, INCLUDING AS A MARKETING CARRIER IN CODE-SHARING OR \nBLOCKED-SPACE ARRANGEMENTS OR OWNED, CHARTERED OR OPERATED BY A \nRUSSIAN NATURAL OR LEGAL PERSON, ENTITY OR BODY ARE PROHIBITED TO \nLAND IN, TAKE OFF FROM OR OVERFLY THE FRENCH SOVEREIGN AIRSPACE \nEXCEPT IN CASE OF EMERGENCY LANDING OR EMERGENCY OVERFLIGHT AND \nEXCEPT FOR FLIGHTS HOLDING A PERMISSION DELIVERED IN ACCORDANCE WITH \nTHE APPROPRIATE UE REGULATION BY THE FRENCH AUTHORITIES\n2- ALL AIRCRAFTS OPERATED BY BELARUSIAN AIR CARRIERS, INCLUDING AS A \nMARKETING CARRIER IN CODE-SHARING OR BLOCKED-SPACE ARRANGEMENTS, TO \nLAND IN, TAKE OFF FROM OR OVERFLY THE FRENCH SOVEREIGN AIRSPACE \nEXCEPT IN CASE OF EMERGENCY LANDING OR EMERGENCY OVERFLIGHT AND \nEXCEPT FOR FLIGHTS HOLDING A PERMISSION DELIVERED IN ACCORDANCE WITH \nTHE APPROPRIATE UE REGULATION BY THE FRENCH AUTHORITIES\n3- IT SHALL BE PROHIBITED TO PARTICIPATE, KNOWINGLY AND \nINTENTIONALLY, IN ACTIVITIES THE OBJECT OR EFFECT OF WHICH IS TO \nCIRCUMVENT THESE PROHIBITIONS.\nCREATED: 30 Aug 2022 11:47:00 \nSOURCE: EUECYIYN",
