      "message": "MILITARY INVASION OF UKRAINE BY RUSSIAN FEDERATION POSES A HIGH\nRISK FOR CIVIL FLIGHTS OPERATING AT ALL ALTITUDES AND FLIGHT LEVELS.\nAIR CARRIERS AND CAPTAINS OF ACFT IN CHARGE OF AIR SERVICE MANAGED\nBY CARRIERS HOLDERS OF OPERATING LICENCE ISSUED BY FRANCE, WHETHER\nTHEY ARE CONTRACTUAL CARRIERS AND/OR DE FACTO CARRIERS, OR\nPERFORMING AIR SERVICE WITH COMMERCIAL CHARTER AGREEMENT OR WITH\nCODE SHARING AND TO ALL FLIGHT PERFORMED WITH FRENCH ACFT\nREGISTRATION ARE REQUESTED TO :\n- NOT ENTER FIR LVIV (UKLV), FIR KYIV (UKBV), FIR DNIPROPETROVSK\n(UKDV), FIR SIMFEROPOL (UKFV), FIR ODESA (UKOV), FIR MINSK (UMMV)\nAND FIR CHISINAU (LUUU)\n- NOT ENTER WITHIN 200 NM OF THE UKRAINIAN BORDER INTO THE FIR\nMOSCOW (UUWV) AND ROSTOV-NA-DONU (URRV)\n- EXERCISE EXTREME CAUTION WHEN CONDUCTING FLIGHTS BEYOND 200 NM OF\nTHE UKRAINIAN BORDER IN FIR MOSCOW (UUWV) AND FIR ROSTOV-NA-DONU\n(URRV). THIS NOTAM SUPERSEDES THE RESTRICTIONS CONCERNING UKRAINE\nISSUED IN AIC 10/22.\nCREATED: 16 Aug 2022 06:43:00 \nSOURCE: EUECYIYN",
